var keymap = [[1,2,3],
             [4,5,6],
             [7,8,9]]
var currentPosition = [1,1];
var instructions = ",,,,".split(",");

instructions.forEach(function(instructionRow) {
  instructionRow.split("").forEach(function(instruction) {
      var newPosition = Move(instruction, currentPosition);
      currentPosition[0] = newPosition[0];
      currentPosition[1] = newPosition[1];
  });
  console.log(lookKey(keymap, currentPosition));
}); 


function Move(instruction, currentPosition) {
  var newPosition = [currentPosition[0] , currentPosition[1]];
  switch(instruction){
      case "U":
        newPosition[0] = newPosition[0] - 1;
        break;
      
      case "D":
        newPosition[0] = newPosition[0] + 1;
        break;

      case "L":
        newPosition[1] = newPosition[1] - 1;
        break;
      
      case "R":
        newPosition[1] = newPosition[1] + 1;
        break;
  }

  if(validMove(newPosition, keymap)) {
    return newPosition;
  }
  return currentPosition;
}

function validMove(newPosition, keymap)
{
  if (newPosition[0]<0 || newPosition[1]<0) {
      return false;
  }
  if (newPosition[0]>=keymap.length){
    return false;
  }
  if (newPosition[1] >=keymap[0].length) {
    return false;
  }
  return true;
}

function lookKey(keymap, currentPosition){
  return keymap[currentPosition[0]][currentPosition[1]]; 
}